    """Makes neighborhood column using functions above"""
    neighborhood_col = []
    for i in range(len(df['Latitude'])):
       neighborhood_col.append(get_neighborhood_for_point(df['Latitude'][i], df['Longitude'][i]))
    df['neighborhood'] = neighborhood_col
    return df

